import React, { Component } from "react";
import "./styles.css";
import Greeting from "../DoctorDashboard/Greeting/Greeting";
import UserTable from "./UserTable";
import Navbar from "../HomePage/Navbar";
import { logout } from "../../actions/admin";
import { Container } from "reactstrap";

const patient_A = {
  type: "patient",
  name: "A",
  userId: "100",
  password: "abcd",
  history: null,
  province: "BC",
};
const patient_B = {
  type: "patient",
  name: "B",
  userId: "101",
  password: "1234",
  history: null,
  province: "ON",
};
const patient_C = {
  type: "patient",
  name: "C",
  userId: "102",
  password: "asdfghjkl",
  history: null,
  province: "AB",
};
const new_admin = {
  name: "Nero",
  userId: "001",
  type: "admin",
  password: "getA++in309",
  province: "",
};
const all_user = [patient_A, patient_B, patient_C, new_admin];
class AdminDashboard extends Component {
  constructor(props) {
    //
    super(props);
    this.props.history.push("/AdminHome"); //
  }
  state = {
    message: { type: "", body: "" },
    username: this.props.app.state.currentAdmin.username,
    id: this.props.app.state.currentAdmin._id
  };

  logoutAdmin = (app) => {
    this.props.history.push("/AdminLogin");
    logout(app);
  };

  render() {
    const { app } = this.props;
    return (
      <div>
        <Navbar />
        <Container>
          <div className="admin_dashboard_background">
            <Greeting
              className="greeting"
              name={this.state.username}
              userId={this.state.id}
            />{" "}
            <br />
            <button
              type="button"
              class="btn btn-warning"
              onClick={() => this.logoutAdmin(app)}
            >
              Logout
            </button>
            <div className="table">
              <UserTable users={all_user} />
            </div>
          </div>
        </Container>
      </div>
    );
  }
}

export default AdminDashboard;
